INSERT INTO `pages` (`id`, `name`, `text`, `seo_title`, `seo_keywords`, `seo_description`, `url`, `code`, `noindex`, `is_disabled`, `created_at`, `updated_at`, `images`, `page_category_id`, `sort`) VALUES (25, 'a:2:{s:2:"ru";s:62:" Максимальная защита вашего сайта";s:2:"en";s:32:"Maximum protection for your site";}', 'a:2:{s:2:"ru";s:286:"Минимальная вероятность санкций со стороны поисковых систем. Наш код проверен на многих сайтах и практически исключает какие-либо проблемы с поисковиками.";s:2:"en";s:286:"Минимальная вероятность санкций со стороны поисковых систем. Наш код проверен на многих сайтах и практически исключает какие-либо проблемы с поисковиками.";}', 'a:2:{s:2:"ru";s:0:"";s:2:"en";s:0:"";}', 'a:2:{s:2:"ru";s:0:"";s:2:"en";s:0:"";}', 'a:2:{s:2:"ru";s:0:"";s:2:"en";s:0:"";}', '', 'defense', 1, 0, 1456822862, 1457804307, 'a:1:{i:0;s:65:"/uploads/pages/pages/gallery/HO9zIiFvgMs3TxanobG-ORGad2pvmx4l.png";}', 5, 4);
INSERT INTO `pages` (`id`, `name`, `text`, `seo_title`, `seo_keywords`, `seo_description`, `url`, `code`, `noindex`, `is_disabled`, `created_at`, `updated_at`, `images`, `page_category_id`, `sort`) VALUES (47, 'a:2:{s:2:"ru";s:14:"Лендинг";s:2:"en";s:7:"Landing";}', 'a:2:{s:2:"ru";s:1066:"<p class="how-note__par">Мы предоставим контент абонентам мобильных операторов (МТС, Мегафон, Теле2, Билайн, Азербайджан и т.д.). Схема работы, весь контент, сервисы и лендинги строго соответствуют правилам всех операторов и не содержат запрещенный в РФ материал. Кроме\r\n          того после подписки абоненту приходит смс-сообщение от операторов с информацией о подписке ее стоимостью, а так же информацией об отключении.</p>\r\n\r\n        <p>* - Списание происходит каждый день примерно в одно и то же время. Подписка будет приносить вам доход вплоть до отключения абонентом. Многие подписки живут год и более</p>";s:2:"en";s:1066:"<p class="how-note__par">Мы предоставим контент абонентам мобильных операторов (МТС, Мегафон, Теле2, Билайн, Азербайджан и т.д.). Схема работы, весь контент, сервисы и лендинги строго соответствуют правилам всех операторов и не содержат запрещенный в РФ материал. Кроме\r\n          того после подписки абоненту приходит смс-сообщение от операторов с информацией о подписке ее стоимостью, а так же информацией об отключении.</p>\r\n\r\n        <p>* - Списание происходит каждый день примерно в одно и то же время. Подписка будет приносить вам доход вплоть до отключения абонентом. Многие подписки живут год и более</p>";}', 'N;', 'N;', 'N;', NULL, 'landing', 1, 0, 1456993524, 1457687169, 'a:0:{}', 1, 100);
